import React, { useState } from "react";


function App() {
    const date = new Date();
    const currentHour = date.getHours()+ ":" +date.getMinutes()+ ":" +date.getSeconds;

    const[count,setCounter]=useState(0);
    const IncNum = () => {
        setCounter(count+1)
    }

    return (
        <>
          <h1>{count}</h1>
          <button onClick={IncNum}>Click Me</button> 
        </>

    );
}

export default App;
